&lt;h3&gt;10-Position Rotary Switch - KIT Version&lt;/h3&gt;
&lt;p&gt;Taiwan Alpha 1 pole, 10 pos rotary switch.&lt;/p&gt;
&lt;p&gt;Arrows in tDocu denote pointer positions for 45-degree shaft, assuming a knob with a pointer that's opposite the set screw.&lt;/p&gt;
&lt;p&gt;&lt;b&gt;Warning:&lt;/b&gt; This is the KIT version of this package. This package has a smaller diameter top stop mask, which doesn't cover the diameter of the pad. This means only the bottom side of the pads' copper will be exposed. You'll only be able to solder to the bottom side.&lt;/p&gt;
&lt;p&gt;&lt;a href=&quot;https://cdn.sparkfun.com/datasheets/Components/Switches/SP14040026%20SPEC.pdf&quot;&gt;Datasheet&lt;/a&gt; (Alpha PN SR2512F-0110-16f2b-c9-s-k)&lt;/p&gt;
